              if (right > axisx.max) {
                  right = axisx.max;
                  drawRight = false;
              }
  
              if (bottom < axisy.min) {
                  bottom = axisy.min;
                  drawBottom = false;
              }
  
              if (top > axisy.max) {
                  top = axisy.max;
                  drawTop = false;
              }
  
